import React from 'react';
import styles from './video_list.module.css';
import VideoItem from '../video_item/video_item';

const VideoList = ({ videos }) => {
  return (
    <ul className={styles.videos}>
      {videos.map(video => {
        <VideoItem video={video} />;
      })}
    </ul>
  );
};

export default VideoList;
